import React from "react";

import "./carousel.css";

import slide1 from "../../images/carousel/carousel1.jpg";
import slide2 from "../../images/carousel/carousel2_2.jpg";
import slide3 from "../../images/carousel/carousel3_2.jpg";
import slide4 from "../../images/carousel/carousel4_2.jpg";

export default function ControlledCarousel() {
  return (
    <div
      id="carouselExampleControls"
      className="carousel slide"
      data-bs-ride="carousel"
    >
      <div className="carousel-inner ">
        <div className="carousel-item active">
          <img src={slide1} className="rounded mx-auto d-block w-50" alt="..." />
        </div>
        <div className="carousel-item">
          <img src={slide2} className="rounded mx-auto d-block w-50" alt="..." />
        </div>
        <div className="carousel-item">
          <a href="https://github.com/ossu/computer-science">
            <img src={slide3} className="rounded mx-auto d-block w-50" alt="..." />
          </a>
        </div>
        <div className="carousel-item">
          <img src={slide4} className="rounded mx-auto d-block w-50" alt="..." />
        </div>
      </div>
      <button
        className="carousel-control-prev"
        type="button"
        data-bs-target="#carouselExampleControls"
        data-bs-slide="prev"
      >
        <span className="carousel-control-prev-icon" aria-hidden="true"></span>
        <span className="visually-hidden">Previous</span>
      </button>
      <button
        className="carousel-control-next"
        type="button"
        data-bs-target="#carouselExampleControls"
        data-bs-slide="next"
      >
        <span className="carousel-control-next-icon" aria-hidden="true"></span>
        <span className="visually-hidden">Next</span>
      </button>
    </div>
  );
}

